        # ['\x1b\t000500007900', '낚시보단 낫네', 'popcard1203', '0', '0', '3', '삭붐', '536952832|32768', '-1', '047143', '45A48D', '']
        # ['\x1b\t000500007100', '리겜같넼ㅋㅋ', 'nsaebin', '0', '0', '3', '빼꼼_', '82432|32768', '-1', '0C61E1', '5C82E3', '']
